#include <stdio.h>
#include <string.h>

#define LOG_FILE "cyberpunk_log.txt"
#define MAX_ENTRIES 1000

typedef struct {
  int timestamp;
  char type[10];
  char message[100];
} log_entry_t;

int main() {
  log_entry_t log[MAX_ENTRIES];
  int num_entries = 0;
  int i;
  char line[100];
  FILE *fp;

  // Open the log file
  fp = fopen(LOG_FILE, "r");
  if (fp == NULL) {
    printf("Error opening log file\n");
    return 1;
  }

  // Read the log file and store the entries in an array
  while (fgets(line, sizeof(line), fp) != NULL) {
    if (num_entries >= MAX_ENTRIES) {
      printf("Maximum number of entries reached\n");
      break;
    }

    log[num_entries].timestamp = atoi(strtok(line, " "));
    strcpy(log[num_entries].type, strtok(NULL, " "));
    strcpy(log[num_entries].message, strtok(NULL, " "));
    num_entries++;
  }

  // Close the log file
  fclose(fp);

  // Print the entries in reverse order
  for (i = num_entries - 1; i >= 0; i--) {
    printf("%d: %s: %s\n", log[i].timestamp, log[i].type, log[i].message);
  }

  return 0;
}